using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class ClipSlotHoleModel : Notifier	{		public ClipSlotHoleModel()		{					Div = "";			ht = "";			wd = "";		}				private string _Div;		public string Div			{				get { return _Div; }				set				{					_Div = value;					OnPropertyChanged(nameof(Div));				}			}				private string _ht;		public string ht			{				get { return _ht; }				set				{					_ht = value;					OnPropertyChanged(nameof(ht));				}			}				private string _wd;		public string wd			{				get { return _wd; }				set				{					_wd = value;					OnPropertyChanged(nameof(wd));				}			}			}}